import React, { Component } from "react";
import Pm_number3 from "./Pm_number3";

class Dashboard extends Component {
    constructor() {
        super();
    }
    render() {
        return (
            <div>
                <div>
                    <div className="dashBoardHeader" id="header" onClick={this.username}>
                        <h1>Hello&nbsp;&nbsp;</h1>
                    </div>
                </div>
            </div>
        );
    }
}
export default Dashboard;
